import React from 'react';
import logo from './logo.svg';
import './App.css';

//STATE

function Clicker() {
  function handleClick(e) {
    alert('berhasil mengklik!')
    e.preventDefault()
  }

  return (
    <a href="#" onClick={handleClick}> Clik Bro Sis! </a>
  )
}


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />        
      </header>
      <Clicker />
    </div>
  );
}

export default App;
